import React, {Component, Fragment} from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            inputValue: '',
            list: {}
        }
    }

    render() {
        return (
            <Fragment>
                <div>
                    <input value={this.state.inputValue}/>
                </div>
            </Fragment>
        )
    }
}

export default App;
